&quot;Was sind Hater? Es sind in erster Linie Menschen, die andere diskriminieren. Aufgrund von ihrem Aussehen.&quot;
Ja. Geht gar nicht.
&quot;Aufgrund von ihrer schulischen Bildung.&quot;
Stimmt. So was gehört sich nicht.
&quot;Aufgrund von ihrer Hautfarbe.&quot;
Ja, leider. Eine Frechheit!
&quot;Aufgrund von ihrer ethnischen Gesinnung.&quot;
Gibbet nich. Du meinst *ethische* Gesinnung. Was ist das? Nun, dass man z.B. nicht sonntags grundlos mit einem tonnenschweren Verbrenner-Auto zwecks Erwerbs und Verkostung eines Energydrinks zur Tanke fährt und auf diese Weise den menschengemachten Klimawandel beschleunigt.
